  color: var(--color-headings);
  padding: 0.5rem 2rem;
  white-space: nowrap;
}

.block-domain__prices .badge {
  margin-bottom: 2rem;
  width: fit-content;
}

.badge--primary {
  background: #126de4;
  color: #fff;
}

.badge--secondary {
  background: var(--color-secondary);
  color: #fff;
}

.badge--small {
  font-size: 1.6rem;
  padding: 0.5rem 1.5rem;
}

@media screen and (min-width: 1024px) {
  .badge {
    font-size: 1.5rem;
  }

  .badge--small {
    font-size: 1.2rem;
  }

  .block-domain__prices .badge {
    font-size: 2rem;
  }
}
/* Lists */
.list {
  list-style: none;
  padding-left: 0;
  color: var(--color-headings);
}

.list--inline .list__item {
  display: inline-block;
  margin-right: 2rem;
}

.list--tick {
  list-style-image: url(../images/tick.svg);
  padding-left: 3rem;
}

.list--tick .list__item {
  padding-left: 0.5rem;
  margin-bottom: 1rem;
}

@media screen and (min-width: 1024px) {
  .list--tick .list__item {
    padding-left: 0;
  }
}
/* Icons */
.icon {
  width: 40px;
  height: 40px;
}

.icon--primary {
  fill: var(--color-primary);
}

.icon--secondary {
  fill: var(--color-secondary);
}

.icon--white {
  fill: #fff;
  box-shadow: none;
}

.icon-container {
  background: #f3f9fa;
  width: 64px;
  height: 64px;
  border-radius: 100%;
  display: inline-flex;
  justify-content: center;
  align-items: center;
}

/* Buttons */
.btn {
  border-radius: 40px;
  border: 0;
  cursor: pointer;
  font-size: 1.8rem;
  font-weight: 600;
  margin: 1rem 0;
  padding: 2rem 4vw;
  text-align: center;
  text-transform: uppercase;
  white-space: nowrap;
}

.btn .icon {
  width: 2rem;
  height: 2rem;
  margin-right: 1rem;
  vertical-align: middle;
}

.btn--primary {
  background: var(--color-primary);
  color: #fff;
}

.btn--primary:hover {
  background: #3a8ffd;
}

.btn--secondary {
  background: var(--color-secondary);
  color: #fff;
}

.btn--secondary:hover {
  background: #05cdf0;
}

.btn--accent {
  background: var(--color-accent);
  color: #fff;
}

.btn--accent:hover {
  background: #ec3000;
}

.btn--outline {
  background: #fff;
  color: var(--color-headings);
  border: 2px solid var(--color-headings);
}

.btn--outline:hover {
  background: var(--color-headings);
  color: #fff;
}

.btn--stretched {
  padding-left: 6rem;
  padding-right: 6rem;
}

.btn--block {
  width: 100%;
  display: inline-block;
}

@media screen and (min-width: 1024px) {
  .btn {
    font-size: 1.5rem;
  }
}

/* Inputs */
.input {
  border-radius: var(--border-radius);
  border: 1px solid var(--color-border);
  color: var(--color-headings);
  font-size: 2rem;
  outline: 0;
  padding: 1.5rem 3.5rem;
  width: 100%;
}

::placeholder {
  color: #cdcbd7;
}

.input-group {
  border: 1px solid var(--color-border);
  border-radius: var(--border-radius);
  display: flex;
}

.input-group .input {
  border: 0;
  flex-grow: 1;
  padding: 1.5rem 1rem;
  width: 0;
}

.input-group .btn {
  margin: 4px;
}

@media screen and (min-width: 1024px) {
  .input {
    font-size: 1.5rem;
  }
}
/* Cards */
.card {
  border-radius: 7px;
  box-shadow: 0 0 20px 10px #f3f3f3;
  overflow: hidden;
}

.card__header,
.card__body {
  padding: 2rem 3rem;
}

.card--primary .card__header {
  background: var(--color-primary);
  color: #fff;
}

.card--secondary .card__header {
  background: var(--color-secondary);
  color: #fff;
}

.card--secondary .badge--secondary {
  background: #02cdf1;
}

/* Plans */
.plan {
  border-radius: 7px;
  overflow: hidden;
  transform: scale(1);
  transition: transform 0.3s;
  box-shadow: 0px 0px 80px #d8d8d8;
  width: 100%;
}

.plan:hover,
.plan--popular:hover {
  transform: scale(1.05);
  transition: transform 0.3s;
}

.plan__name {
  color: #fff;
  margin: 0;
  font-weight: 500;
  font-size: 2.4rem;
}

.plan__price {
  font-size: 6rem;
}

.plan__billing-cycle {
  font-size: 2.4rem;
  font-weight: 300;
  opacity: 0.8;
  margin-right: 1rem;
}

.plan__description {
  font-size: 2rem;
  font-weight: 300;
  letter-spacing: 1px;
  display: block;
}

.plan .list__item {
  margin-bottom: 2rem;
}

.plan--popular {
  transform: scale(1.1);
  transition: transform 0.3s;
}

.plan--popular:hover {
  transform: scale(1.15);
  transition: transform 0.3s;
}

.plan--popular .card__header {
  position: relative;
}

.plan--popular .card__header::before {
  content: url(../images/popular.svg);
  width: 40px;
  display: inline-block;
  position: absolute;
  top: -6px;
  right: 5%;
}

@media screen and (min-width: 1024px) {
  .plan__name {
    font-size: 1.4rem;
  }

  .plan__price {
    font-size: 5rem;
  }

  .plan__billing-cycle {
    font-size: 1.6rem;
  }

  .plan__description {
    font-size: 1.7rem;
  }
}
/* Media */
.media {
  display: flex;
  margin-bottom: 2.4rem;
}

.media__title {
  margin-top: 0;
  color: white;
  font-weight: 500;
}

.media__body {
  margin: 0 2rem;
  text-align: left;
}

.media__image {
  margin-top: 1rem;
}

/* Quotes */
.quote {
  margin: 3rem 4rem;
}

.quote-body {
  font-size: 3rem;
  font-style: italic;
  color: #5c5577;
  font-weight: 400;
  line-height: 1.3;
  margin-bottom: 3rem;
}

.quote--footer {
  display: flex;
  line-height: 1.3;
}

.quote__name {
  margin: 0 2rem;
}

.quote__name h3 {
  margin: 0;
  font-weight: 500;
}

.quote__name p {
  font-size: 2rem;
  margin-bottom: 2rem;
  font-weight: 300;
  color: #bcb9cb;
}

@media screen and (min-width: 1024px) {
  .quote {
    margin: 2rem 4rem;
  }

  .quote-body {
    margin-bottom: 2rem;
    font-size: 2rem;
  }

  .quote__name h3 {
    font-size: 2.4rem;
  }

  .quote__name p {
    font-size: 1.6rem;
    margin-bottom: 1.8rem;
  }
}

/* Grids */
.grid {
  display: grid;
  width: 100%;
}

.grid--1x3 {
  text-align: left;
  grid-gap: 8rem;
  max-width: 500px;
  margin: 0 auto;
}

.grid--2x3 {
  grid-template-columns: repeat(2, 1fr);
  max-width: 700px;
}

.grid--1x2 {
  grid-gap: 4rem;
}

@media screen and (min-width: 768px) {
  .grid--1x2 {
    grid-template-columns: repeat(2, 1fr);
    width: 100%;
  }
}

@media screen and (min-width: 1024px) {
  .grid--1x3 {
    grid-template-columns: repeat(3, 1fr);
    max-width: 100%;
    grid-gap: 4rem;
  }
}

/* Testimonial */
.allincluded-testimonial {
  padding: 3rem;
  margin: auto;
  box-shadow: 0px 0px 20px #d8d8d8;
  max-width: 1024px;
  border-radius: 5px;
}

.testimonial--inside {
  display: grid;
}

.quote-body {
  text-align: left;
}

.img__quote {
  position: relative;
}

.img__quote img {
  width: 100%;
  padding: 0 3rem;
}

.img__quote .icon {
  fill: #fff;
  width: 30px;
  height: 30px;
}

.img__quote .icon-container {
  background: var(--color-accent);
  position: absolute;
  right: 0;
  top: 3rem;
}

@media screen and (min-width: 768px) {
  .testimonial--inside {
    grid-template-columns: repeat(2, 1fr);
  }

  .img__quote {
    position: relative;
  }

  .img__quote img {
    padding: 0;
    padding-bottom: 1rem;
  }

  .img__quote .icon-container {
    position: absolute;
    right: -32px;
    top: 3rem;
  }

  .quote {
    margin: 2rem 0rem;
    margin-left: 6rem;
  }

  .quote-body {
    margin-bottom: 2rem;
    font-size: 2.4rem;
  }

  .quote__name h3 {
    font-size: 2.4rem;
  }

  .quote__name p {
    font-size: 1.6rem;
    margin-bottom: 1.8rem;
  }
}

/* Callout */
.callout {
  display: grid;
  background-color: var(--color-primary);
  padding: 4rem;
  border-radius: 1%;
  text-align: center;
}

.callout h3 {
  color: white;
  margin-top: 0;
}

.callout p {
  color: white;
}

.callout .btn {
  width: fit-content;
  padding: 2rem 6rem;
}

@media screen and (min-width: 768px) {
  .callout {
    grid-template-columns: repeat(2, 1fr);
    text-align: left;
    align-items: center;
    display: inline-grid;
    grid-template-columns: auto auto;
  }

  .callout .btn {
    margin: 0 2rem;
  }

  .callout h3 {
    font-size: 3rem;
  }
}

/* Collapsibles */
.collapsible__header {
  display: flex;
  justify-content: space-between;
}

/* .site-header .collapsible__header {
  flex-direction: row-reverse;
} */

.collapsible__heading {
  margin-top: 0;
  font-size: 3rem;
}

.collapsible__chevron {
  transform: rotate(0);
  transition: transform 0.3s;
}

.collapsible__chevron:hover {
  cursor: pointer;
}

.collapsible--expanded .collapsible__content {
  max-height: 0;
  overflow: hidden;
  opacity: 0.95;
  transition: all 0.5s;
}

.collapsible__content {
  max-height: 100vh;
  opacity: 1;
  transition: 0.5s;
}

.collapsible--expanded .collapsible__chevron {
  transform: rotate(-90deg);
  transition: transform 0.3s;
}

/* Blocks */
.block {
  padding: 4rem 2rem;
  text-align: center;
}

.block--dark {
  background-color: black;
}

.block--left-angle {
  clip-path: polygon(0 0, 100% 0, 100% 80%, 0 100%);
}

.block--right-angle {
  clip-path: polygon(0 0, 100% 0, 100% 100%, 0 80%);
}

.block__heading {
  /* margin-top: 0; */
  color: white;
}

.block__body {
  margin: 3rem;
  margin-top: 0;
  color: #979fa9;
}

.container {
  max-width: 1140px;
  margin: 0 auto;
}

/* NavBar */
.collapsible {
  display: flex;
  flex-direction: column;
}

.collapsible__header {
  fill: var(--color-body);
  transition: fill 10s;
  background-color: black;
  align-items: center;
  padding: 0 1rem;
}

.collapsible__header .logo {
  margin: 0.5rem 0;
}

.collapsible__header .collapsible__menu {
  cursor: pointer;
  fill: white;
  box-shadow: 0 0 0 3px #666;
  border-radius: 5px;
  transition: fill 0.2s;
}

.collapsible--expanded .collapsible__header .collapsible__menu {
  opacity: 1;
  box-shadow: 0 0 0 0px #666;
  transition: all 0.2s;
}

.collapsible__content .item--collapsible {
  margin: 0;
  padding: 0 1rem;
  background-color: black;
  display: flex;
  flex-direction: column;
  list-style-type: none;
}

.collapsible__content .item--collapsible a {
  margin: 0 2rem;
  padding: 0.5rem 0;
  border-bottom: 1px solid #242424;
  list-style-type: none;
  transition: font-size 0.15s;
}

.item--collapsible .menu__item {
  width: fit-content;
  cursor: pointer;
  margin-bottom: 0;
  color: white;
  opacity: 0.8;
  transition: opacity 0.2s;
}

.item--collapsible .menu__item:hover {
  opacity: 1;
  transition: opacity 0.2s;
}

@media screen and (min-width: 768px) {
  .collapsible__header .icon {
    height: 0;
    width: 0;
    visibility: hidden;
  }

  .collapsible {
    flex-direction: row;
    justify-content: space-between;
    background-color: black;
  }

  .collapsible__content .item--collapsible {
    flex-direction: row;
    font-size: 1.6rem;
    transition: font-size 0.15s;
    align-items: center;
    height: 100%;
  }

  .collapsible__content .item--collapsible a {
    border-bottom: none;
  }

  .collapsible__content {
    max-height: 100vh;
    opacity: 1;
    /* transition: all 0.3s; */
  }

  .collapsible--expanded .collapsible__content {
    max-height: 100vh;
    opacity: 1;
    /* overflow: hidden; */
    /* opacity: 0; */
    /* transition: all 0.3s; */
  }
}

