}

.block-domain__prices {
  margin: 0 auto;
  font-size: 2rem;
  font-weight: 600;
  justify-items: center;
  max-width: 700px;
}

@media screen and (min-width: 768px) {
  .grid--2x3 {
    grid-template-columns: repeat(6, 1fr);
  }
}

