}

.features__heading {
  margin-top: 1rem;
}

.img__feature {
  width: 100%;
}

@media screen and (min-width: 768px) {
  .grid--1x2 {
    grid-gap: 2rem;
  }
}

/* Showcase Block */
.showcase__image {
  width: 100%;
}

.showcase-heading h2 {
  color: white;
}

.showcase-block .grid {
  grid-gap: 0;
}

.showcase-block {
  clip-path: polygon(0 0, 100% 0, 100% 100%, 0 90%);
